import React from 'react';
import { TextField,Grid } from '@material-ui/core';

export default class HobyList extends React.Component{
    state = { arrList: [] };
    addToList = (hobby: string) => {
        this.setState({
            arrList: [...this.state.arrList, hobby]
        });
    }
    render() {
        return (
            <div>
                <Grid container justify="center">
                    <TextField id="standard-basic" label="Standard" />
                    </Grid>
            </div>
        )
    }
}
